import { Link } from "react-router-dom"
import { DUMMY_PRODUCTS } from "../../utils"



const Products = () => {
  return (
    <div>
      <h1>Products page</h1>
      <ul>
        <li>
          {DUMMY_PRODUCTS.map((product) => (
            <div key={product.id}>
              <Link to={`products/${product.id}`} ></Link>
            </div>
          ))}
        </li>
      </ul>
    </div>
  )
}

export default Products
